import { Event } from '../models/event';

const Item: React.FC<Event> = ({
    id,
    text,
    date
  }) => {
    return (
    <li>
        <b>{text}</b>
        <p>{date}</p>
        <small>{id}</small>
    </li>
  )
}

export default Item
